import math

def find_prime_numbers(m, n):
    """"""
    isPrime = [True] * (n + 1)
    isPrime[0] = isPrime[1] = False
    for i in range(2, int(math.sqrt(n)) + 1):
        if isPrime[i]:
            for j in range(i * i, n + 1, i):
                isPrime[j] = False
    return [j for j in range(m, n + 1) if isPrime[j]]
